import React from "react";

const PreviewEducation = (props) => {
    const { EducationInfo } = props

    const educationInfo = EducationInfo.map((education) =>
        <div key={education.id}>{education.name}{education.title}{education.date}{education.dateEnd}</div>)

        return(
            <div>{educationInfo}</div>
        )
}

export default PreviewEducation
